svg.script:
let activeYear = 0;
let activeM = null;
let activeA = false;
let activeO = 0;
const npoints = 230; // NB! hardcoded number of points (used for slider logic)


		// all elements in class className is shown or hidden with block or none
		function showHideAll(className,blockOrNone) {
			var el = document.getElementsByClassName(className)
			//console.log(el[0].id)
			//console.log(el[0].getAttribute("cx"))
			//console.log(el[0].getAttribute("class"))
            for(var i = 0; i < el.length; i++){
				el[i].style.display = blockOrNone;
            }
		}

		// all elements in class className is given the color fillColor
		function fillAll(className,fillColor) {
            var el = document.getElementsByClassName(className)
            for(var i = 0; i < el.length; i++){
				el[i].style.fill = fillColor;
            }	
		}

		// change button apperance when pressed to show activation
		function buttonPressed(elementID,labelID) {
			document.getElementById(elementID).style.setProperty("fill-opacity",0.5);
			document.getElementById(labelID).style.setProperty("fill","white");
		}		

		// change button apperance when pressed (reset) to show deactivation
		function buttonReset(elementID,labelID) {
			document.getElementById(elementID).style.setProperty("fill-opacity",0.1);
			document.getElementById(labelID).style.setProperty("fill","black");
		}			

		function markerSize(size) {
			// change marker size
			const sizes = [0.5,1,2]; // sizes of dots
			var el = document.getElementsByClassName("loc")
			for(var i = 0; i < el.length; i++){
				el[i].setAttribute('r',sizes[size-1]);
            }
			var el = document.getElementsByClassName("air")
			for(var i = 0; i < el.length; i++){
				//var transforms = el[i].getAttribute('transform');
				//var parts  = /translate\(\s*([^\s,)]+)[ ,]([^\s,)]+)/.exec(transforms);
				//var firstX = parts[1],
    			//firstY = parts[2];
				//console.log(firstX)
				//console.log(firstY)
				el[i].setAttribute('transform',`translate(${-sizes[size-1]},${-0.8*sizes[size-1]})`);
				el[i].setAttribute('width',2*sizes[size-1]);
				el[i].setAttribute('height',2*sizes[size-1]);
				//console.log(2*sizes[size-1])
				//console.log(`translate(${-sizes[size-1]},${-0.8*sizes[size-1]})`)
            }			
			// fix appearance of buttons
			for(var i = 1; i < 4; i++){
				buttonReset(`size${i}`,`size${i}Label`)
			}
			buttonPressed(`size${size}`,`size${size}Label`)
		}		

        function showType() {
			fillAll("city","red")
			fillAll("temple","blue")
			fillAll("other","green")	
			buttonPressed("type","typeLabel")			
			buttonReset("year","yearLabel")
			buttonReset("times","timesLabel")		
        }

        function showYear() {
			fillAll("y2023","orange")
			fillAll("y2022","orange")
			fillAll("y2019","violet")
			fillAll("y2017","green")
			fillAll("y2015","blue")
			fillAll("y2012","red")
			buttonReset("type","typeLabel")			
			buttonPressed("year","yearLabel")
			buttonReset("times","timesLabel")					
        }  

        function showTimes() {
			fillAll("t5","red")
			fillAll("t4","blue")
			fillAll("t3","green")
			fillAll("t2","orange")
			fillAll("t1","gray")
			buttonReset("type","typeLabel")			
			buttonReset("year","yearLabel")
			buttonPressed("times","timesLabel")											
        } 

         // Year
		function showYN(year) {
			buttonReset(`year${activeYear}`,`year${activeYear}Label`)
			buttonPressed(`year${year}`,`year${year}Label`)
			activeYear = year;
			if (activeO != 0){ 
				showOrder(activeO)   // deactivate order if year is used
			}				

			showHideAll("loc","none")
			if (year == 0){ // show all
				if (activeM == null){
					showHideAll("loc","block")
				} else {
					showHideAll(`m${ activeM }`,"block")	
				}
			} else if (year == 5) { // show 2022 and 2023
				if (activeM == null){
            		showHideAll("y2023","block")
					showHideAll("y2022","block")
				} else {
					showHideAll(`d2022${ String(activeM).padStart(2, '0') }`,"block")	
					showHideAll(`d2023${ String(activeM).padStart(2, '0') }`,"block")	
				}
			} else { // show other year
				const y = ["2012","2015","2017","2019"]
				if (activeM == null){
            		showHideAll(`y${y[year-1]}`,"block")
				} else {
					showHideAll(`d${ y[year-1] }${ String(activeM).padStart(2, '0') }`,"block")	
				}
			} 
		}

        function provinceOn() {
            var el = document.getElementById("provinces")
            el.style.display = "block";
			buttonPressed("provOn","provOnLabel")	
			buttonReset("provOff","provOffLabel")	
		}
        function provinceOff() {
            var el = document.getElementById("provinces")
            el.style.display = "none";
			buttonReset("provOn","provOnLabel")	
			buttonPressed("provOff","provOffLabel")				
		}	


		function showM(number) {
 			// if active, reset (i.e. show all points), else activate & show selected points
			if (activeM == number) {
				activeM = null;				
				buttonReset(`m${ number }`,`m${ number }Label`)	
				showYN(activeYear)
			} else {
				if (activeO != 0){ 
					showOrder(activeO)   // deactivate order if m is used
				}
				if (activeM != null) {
					buttonReset(`m${activeM}`,`m${activeM}Label`)
				}
				buttonPressed(`m${ number }`,`m${ number }Label`)
				activeM = number;

				const y = ["2012","2015","2017","2019"]
				showHideAll("loc","none")
				if (activeYear == 0){
					showHideAll(`m${ number }`,"block")							
				} else if (activeYear == 5){
					showHideAll(`d2022${ String(number).padStart(2, '0') }`,"block")	
					showHideAll(`d2023${ String(number).padStart(2, '0') }`,"block")	
				} else {
					showHideAll(`d${ y[activeYear-1] }${ String(number).padStart(2, '0') }`,"block")	
				}
			} 
		}	


	function showA(){
		if (activeA ==false){
			for(var i = 0; i < 12; i++){
				buttonReset(`m${i+1}`,`m${i+1}Label`)
			}
			for(var i = 0; i < 5; i++){
				buttonReset(`year${i+1}`,`year${i+1}Label`)	
			}	
			buttonPressed("a","aLabel")		
			showHideAll("loc","none")
			showHideAll("air","block")
			activeA = true;
		} else {
			showHideAll("air","none")
			buttonReset("a","aLabel")
			// When slider is deactivated, show old configuration of Y and M.
			if (activeM != null){
				let temp = activeM
				showM(activeM)
				showM(temp)
			} else {
				showYN(activeYear)
			}	
			activeA = false;				
		}
	}






	function showOrder(sortOption){
	if (activeO == sortOption) {
		activeO = 0;
		for(var i = 1; i < 5; i++){
			buttonReset(`o${i}`,`o${i}Label`)	
		}				
		var el = document.getElementById("slider-knob")
    	el.style.display = "none";
    	var el = document.getElementById("slider-activeArea")
    	el.style.display = "none";
		// When slider is deactivated, show old configuration of Y and M.
		buttonReset("year0","year0Label")
		if (activeM != null){
			let temp = activeM
			showM(activeM)
			showM(temp)
		} else {
			showYN(activeYear)
		}

	} else {
		for(var i = 1; i < 5; i++){
			buttonReset(`o${i}`,`o${i}Label`)	
		}			
		activeO = sortOption;
		buttonPressed(`o${ activeO }`,`o${ activeO }Label`)

		// year and m should not be active when Order is used.
			for(var i = 0; i < 12; i++){
				buttonReset(`m${i+1}`,`m${i+1}Label`)
			}
			for(var i = 0; i < 5; i++){
				buttonReset(`year${i+1}`,`year${i+1}Label`)	
			}	
			buttonPressed("year0","year0Label")	
    	document.getElementById("slider-knob").setAttribute("transform", `translate(0 0)`);
    	var el = document.getElementById("slider-knob")
    	el.style.display = "block";
    	var el = document.getElementById("slider-activeArea")
    	el.style.display = "block";
		showHideAll("loc","none") // hide all dots when slider is activated
	}
  	}




  // functions to handle slider logic
  const divider = 560/npoints;
    var down = false;
    var translateX = 0;
    // function to transform mouse input to SVG coordinates
    const toSVGcoordinates = (svg, x, y) => {
      let p = new DOMPoint(x, y);
      return p.matrixTransform(svg.getScreenCTM().inverse());
    };
    document.getElementById("slider-activeArea").addEventListener("mousedown", e => {
      down = true;
      let p = toSVGcoordinates(document.getElementById("svg"), e.clientX, e.clientY);
      let translateX = Math.ceil((p.x-10) / divider) * divider;
      if(translateX < 0) translateX = 0;
      if(translateX > 560) translateX = 560;
      document.getElementById("slider-knob").setAttribute("transform", `translate(${translateX} 0)`);
      showPoint(translateX);
    });
    document.getElementById("svg").addEventListener("mousemove", e => {
      if(down) {
        let p = toSVGcoordinates(document.getElementById("svg"), e.clientX, e.clientY);
        let translateX = Math.ceil((p.x-10) / divider) * divider;
        if(translateX < 0) translateX = 0;
        if(translateX > 560) translateX = 560;
        document.getElementById("slider-knob").setAttribute("transform", `translate(${translateX} 0)`);
        showPoint(translateX);
      }

    });
    document.getElementById("svg").addEventListener("mouseup", e => {
      down = false;
    });

    function showPoint(translateX){
        let locnumber = Math.round(translateX/divider);
        //console.log(locnumber)

		if (activeO == 1){
			let container = document.querySelector('.locgroup');
  			let elements = Array.from(container.children); 
  			let sorted = elements.sort(function(a,b){
		    	return +a.getAttribute('o') - +b.getAttribute('o')
  			});
			//console.log(sorted)
			container.innerHTML = '';
  			sorted.forEach(loc => container.append(loc));
		} else if (activeO == 2){
			let container = document.querySelector('.locgroup');
  			let elements = Array.from(container.children); 
  			let sorted = elements.sort(function(a,b){
		    	return +a.getAttribute('cx') - +b.getAttribute('cx')
  			});
			container.innerHTML = '';
  			sorted.forEach(loc => container.append(loc));
		} else if (activeO == 3){
			let container = document.querySelector('.locgroup');
  			let elements = Array.from(container.children); 
  			let sorted = elements.sort(function(a,b){
		    	return +a.getAttribute('cy') - +b.getAttribute('cy')
  			});
			container.innerHTML = '';
  			sorted.forEach(loc => container.append(loc));			
		} else {
			let container = document.querySelector('.locgroup');
  			let elements = Array.from(container.children); 
  			let sorted = elements.sort(function(a,b){
		    	return +a.getAttribute('id').substring(3) - +b.getAttribute('id').substring(3)
  			});
			container.innerHTML = '';
  			sorted.forEach(loc => container.append(loc));
		}
        var el = document.getElementsByClassName("loc")		
        for(var i = locnumber; i < el.length; i++){
				el[i].style.display = "none";
            }
        for(var i = 0; i < locnumber; i++){
				el[i].style.display = "block";
            }
    }
